import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import styles from '../styles/scss/workflow-starred-finished.module.scss';
import classnames from 'classnames';

const WorkflowStarredAndFinished = ({ starred, finished }) => {
	return (
		<React.Fragment>
			<FontAwesomeIcon icon="star" className={classnames({ [styles.regular]: true })} />
			<FontAwesomeIcon icon="check" className={classnames({ [styles.regular]: true })} />
		</React.Fragment>
	);
};

export default WorkflowStarredAndFinished;
